import "./Skills.css"

const Skills = ()=> {
  return(
    <section className="skills">
      <h2>Skills</h2>
      <ul>
        <li>React</li>
        <li>Node.js</li>
        <li>HTML & CSS</li>
        <li>MongoDB</li>
        <li>JavaScript</li>
      </ul>
    </section>
  )
}

export default Skills;
